import React from 'react';
import {Link, useNavigate } from 'react-router-dom';
import './Login.css';

function user(navigate){
    var userName=document.getElementById('username');
    var pw=document.getElementById('password');
    navigate('/home');
}

function Login(){
    const navigate=useNavigate();
    return (
        <>
            <div className="container">
                <div className="username">
                    <label htmlFor="username">Username: </label>
                    <input tabindex="1" type="text" id="username"/>
                </div>
                <div className="password">
                    <label htmlFor="password">Password:</label>
                    <input tabindex="2" type="password" id="password"/>
                </div>
            </div>
            <div className="container-pw">
                <Link to="/login/forget_password" tabIndex={3} className='forgetpw'>
                    Forgot Password
                </Link>
            </div>
            <div className="button">
                <button tabIndex={4} id="login" onClick={()=>user(navigate)}>Login</button>
            </div>
        </>
    );
}

export default Login;
